import React, { Component } from 'react';
import '../css/NavBar.css';


import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome } from '@fortawesome/free-solid-svg-icons';
import { faInfo } from '@fortawesome/free-solid-svg-icons';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faAddressCard } from '@fortawesome/free-solid-svg-icons';

library.add(faHome);
library.add(faInfo);
library.add(faEnvelope);
library.add(faAddressCard);


export default class NavBar extends Component {

    constructor () {
        this.state = { pageState : "Home" };
    }

    componentDidUpdate( prevProps, prevState )
    {
        console.log("something happened");
    }

    render() {
        return (
            <div id="NavBar" className="NavBar">
                <div className="NavBarHome">
                    <FontAwesomeIcon className="NavBarIcon" icon="home"></FontAwesomeIcon>
                    <div className="NavBarText">Home</div>
                </div>
                <div className="NavBarContact">
                    <FontAwesomeIcon className="NavBarIcon" icon="envelope"></FontAwesomeIcon>
                    <div className="NavBarText">Contact</div>
                </div>
                <div className="NavBarResume">
                    <FontAwesomeIcon className="NavBarIcon" icon="address-card"></FontAwesomeIcon>
                    <div className="NavBarText">Resume</div>
                </div>
                <div className="NavBarAbout">
                    <FontAwesomeIcon id="NavBarIconAbout" className="NavBarIcon" icon="info"></FontAwesomeIcon>
                    <div className="NavBarText">About</div>
                </div>
            </div>
        );
    }
}
